INSERT INTO `marinelife` (`id_marinelife`, `name`, `classification`, `points`, `description`, `id_image`) VALUES
(1, 'Damselfish', 'Fish', 10, 'Ikan Damselfish adalah jenis ikan kecil yang hidup di terumbu karang dan sangat dikenal karena sifat teritorialnya. Ikan ini memiliki warna cerah, seperti biru atau kuning, yang membuatnya mudah dikenali. Damselfish sering kali menghabiskan waktu di kedalaman dangkal perairan tropis, di mana mereka menjaga wilayahnya dengan agresif. Mereka memelihara area di sekitar terumbu dan sering mengusir ikan lain yang mencoba memasuki wilayah mereka. Makanan utama mereka adalah alga, yang mereka konsumsi dengan memakan alga filamen halus yang tumbuh di batuan terumbu karang. Beberapa spesies Damselfish dapat juga memakan invertebrata kecil, tetapi mereka umumnya dikenal sebagai herbivora.', 3),
(2, 'Koi Fish', 'Fish', 20, 'Ikan Koi adalah jenis ikan hias yang terkenal di seluruh dunia, terutama di Jepang. Ikan ini sering dipelihara di kolam dan dikenal dengan tubuhnya yang besar dan warna yang mencolok, seperti merah, oranye, kuning, dan putih. Ikan Koi memiliki makna simbolis yang dalam dalam budaya Jepang, melambangkan kekuatan, ketekunan, dan umur panjang. Mereka dapat tumbuh sangat besar, dengan panjang hingga satu meter, dan memiliki kemampuan untuk hidup hingga beberapa dekade dalam kondisi yang baik. Ikan Koi juga dikenal karena pola warna yang unik dan elegan pada tubuh mereka, membuat mereka sangat dihargai dalam seni akuarium dan kolam hias.', 4),
(3, 'Puffer Fish', 'Fish', 30, 'Ikan Buntal adalah ikan laut yang terkenal karena kemampuan uniknya untuk mengembang menjadi bola besar ketika merasa terancam. Ikan ini memiliki tubuh kecil dan tebal dengan kulit yang keras dan duri yang dapat melindungi dirinya dari pemangsa. Beberapa spesies ikan buntal juga mengandung racun yang sangat berbahaya, yang digunakan sebagai pertahanan terhadap predator. Karena sifat racunnya, ikan ini harus ditangani dengan hati-hati. Pufferfish dapat ditemukan di berbagai habitat laut, termasuk terumbu karang dan perairan tropis. Mereka biasanya memiliki warna-warna cerah yang menarik, seperti hijau, coklat, dan kuning, yang membantu mereka beradaptasi dengan lingkungan sekitar.', 2),
(4, 'Tiger Fish', 'Fish', 10, 'Ikan Harimau adalah spesies ikan predator yang ditemukan di sungai-sungai besar di Afrika, terutama di Sungai Zambezi dan wilayah sekitarnya. Ikan ini terkenal dengan gigi tajamnya yang mirip dengan gigi harimau, yang digunakan untuk memangsa ikan kecil dan hewan air lainnya. Tubuhnya memiliki pola belang yang mencolok, yang memberi mereka penampilan yang mengesankan. Ikan Harimau adalah tantangan besar bagi para pemancing karena kekuatan dan kelincahannya dalam melawan pancing. Mereka lebih suka hidup di perairan yang jernih dan berarus cepat, di mana mereka dapat berburu dengan efisien. Karena sifatnya yang sangat agresif, ikan ini sangat dihargai dalam olahraga memancing.', 5),
(5, 'Manta Ray', 'Fish', 20, 'Ikan Pari Manta adalah salah satu spesies pari terbesar dan paling memukau di dunia. Mereka memiliki tubuh datar dengan sayap besar yang membentang lebar, memberikan mereka penampilan seperti pesawat terbang saat meluncur di bawah permukaan laut. Manta ray dapat mencapai panjang hingga tujuh meter dan dikenal karena kecerdasannya serta kemampuan untuk bermigrasi jauh. Mereka sering ditemukan di perairan tropis dan subtropis, terutama di terumbu karang yang dalam. Manta ray memakan plankton dan ikan kecil dengan cara menyaring air melalui mulut besar mereka. Mereka juga dikenal karena kelakuan sosial mereka, sering terlihat berkelompok atau melakukan atraksi yang menakjubkan di perairan laut terbuka.', 6),
(6, 'Beta Fish', 'Fish', 30, 'Ikan Betta, juga dikenal sebagai ikan cupang, adalah ikan air tawar kecil yang terkenal dengan warna tubuhnya yang cerah dan sirip panjang yang indah. Ikan ini berasal dari Asia Tenggara dan dikenal dengan sifat teritorial yang kuat, terutama pada ikan jantan yang akan bertarung jika ditempatkan bersama. Ikan Betta sering dipelihara dalam akuarium kecil karena ukurannya yang kompak, tetapi mereka memerlukan perhatian khusus untuk menjaga kesehatannya, seperti suhu air yang stabil dan ruang yang cukup. Warna-warni yang spektakuler dari sirip ikan Betta sering menjadi daya tarik utama bagi para penggemar akuarium. Betta juga dikenal karena keindahan gerakan renangnya yang lincah dan elegan.', 7),
(7, 'Purple Fish', 'Fish', 10, 'Ikan ungu merujuk pada berbagai spesies ikan yang memiliki warna dominan ungu pada tubuhnya. Warna ini bisa muncul karena pigmen alami atau adaptasi terhadap lingkungan mereka. Beberapa ikan laut dalam, seperti beberapa spesies dari keluarga Pomacentridae, memiliki tubuh berwarna ungu sebagai bentuk perlindungan atau sebagai cara untuk menarik pasangan. Ikan ungu dapat ditemukan di berbagai kedalaman perairan laut dan sering kali memiliki pola warna yang menarik serta perilaku yang spesifik, termasuk kecenderungan untuk hidup di antara terumbu karang atau di perairan yang kaya akan kehidupan laut.', 10),
(8, 'Dori Fish', 'Fish', 20, 'Ikan Regal Tang, lebih dikenal dengan nama Dori, adalah ikan laut yang terkenal berkat penampilannya yang mencolok dan perilakunya yang ramah. Ikan ini memiliki tubuh berwarna biru cerah dengan garis-garis kuning yang mencolok, menjadikannya salah satu ikan yang paling dikenal di dunia bawah laut. Dori juga menjadi karakter utama dalam film animasi \"Finding Nemo\" dan \"Finding Dory,\" yang membuatnya semakin populer. Selain penampilannya, ikan ini dikenal karena sifatnya yang ramah dan sering kali terlihat berenang dengan lincah di sekitar terumbu karang. Regal Tang sering kali ditemukan di perairan tropis, di mana mereka berfungsi sebagai pemangsa alga dan menjaga keseimbangan ekosistem laut.', 8),
(9, 'Nemo Fish', 'Fish', 30, 'Ikan Clownfish, yang dikenal luas sebagai Ikan Nemo, adalah ikan kecil yang hidup dalam simbiosis dengan anemon laut. Ikan ini memiliki tubuh berwarna oranye cerah dengan tiga garis putih tebal di tubuhnya dan memiliki karakteristik perilaku yang ramah dan sangat sosial. Dalam hubungan simbiotiknya, Ikan Nemo tinggal di antara tentakel anemon yang beracun dan dilindungi dari predator. Sebagai balasannya, ikan ini membersihkan anemon dari parasit dan memberikan perlindungan dari predator yang lebih besar. Ikan Clownfish sangat terkenal setelah karakter utamanya, Nemo, muncul dalam film animasi terkenal, yang semakin memperkenalkan ikan ini kepada dunia.', 9),
(10, 'Bomb', 'Obstacle', 1, '', 11),
(11, 'Barrel', 'Obstacle', 1, '', 12),
(12, 'Shark', 'Obstacle', 2, '', 13);

